import React, {useEffect, useState} from 'react';
import axios from 'axios';
import {Route, Routes} from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import BoardListDB from "./routes/BoardListDB.js";
import BoardListOS from './routes/BoardListOS.js';
import Home from "./routes/Home.js";

function App() {
    const [test, setTest] = useState('')

    useEffect(() => {
        axios.get('/api/select')
            .then(response => setTest(response.data))
            .catch(error => console.log(error))
    }, []);

    return (

    <div>백엔드에서 가져온 데이터입니다 : {test}
        <Routes>
            <Route path="/board_os" element={<BoardListOS/>}/>
            <Route path="/board_db" element={<BoardListDB/>}/>
            <Route path="/Home" element={<Home/>}/>
        </Routes>

    </div>

    );
}

export default App;
